import { useDispatch } from "react-redux";
import { useHistory } from 'react-router-dom';
import  {addName, addEmail, addPassword} from '../actions/usersAction'
import { useSelector } from 'react-redux'

function Account() {

    const history = useHistory();
    const state = useSelector((state) => {return state});

    const name = state.nameReducer
    const email = state.emailReducer
    const password = state.passwordReducer
    const dispatch = useDispatch();




    return (
        <div>
                <h1>Ditt konto</h1>

            <label >NAME </label>
            <input type="text" onChange={ (e) => dispatch(addName(e.target.value))}value={name}/>

            <label >EMAIL</label>
            <input type="text" onChange={ (e) => dispatch(addEmail(e.target.value))} value={email}/>

            <label >PASSWORD</label>
            <input type="password" onChange={ (e) => dispatch(addPassword(e.target.value))} value={password}/>

            <button onClick = {() => history.push('/change')}>Spara</button>


        </div>




    )
}

export default Account;
